// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ChessGame {
    address payable public owner;
    uint256 public totalPrize;
    uint256 public entryFee;
    address public player1;
    address public player2;
    bool public gameFinished;

    constructor() {
        owner = payable(msg.sender);
        entryFee = 1 ether; // Adjust the entry fee as desired
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the contract owner can perform this action");
        _;
    }

    modifier gameNotFinished() {
        require(!gameFinished, "The game has already finished");
        _;
    }

    function enterGame() external payable gameNotFinished {
        require(msg.value == entryFee, "Invalid entry fee");
        require(player1 == address(0) || player2 == address(0), "The game is full");

        if (player1 == address(0)) {
            player1 = msg.sender;
        } else {
            player2 = msg.sender;
        }

        if (player1 != address(0) && player2 != address(0)) {
            totalPrize = address(this).balance;
        }
    }

    function makeMove() external payable gameNotFinished {
        require(msg.sender == player1 || msg.sender == player2, "Invalid player");
        require(msg.value == entryFee, "Invalid move fee");
        // Add logic for handling the chess move

        if (gameFinished) {
            distributePrize();
        }
    }


    function distributePrize() internal gameNotFinished {
        address payable winner;

        // Add logic to determine the winner based on the chess game outcome

        if (winner == player1 || winner == player2) {
            uint256 prizeAmount = (totalPrize * 70) / 100;
            uint256 ownerAmount = (totalPrize * 20) / 100;
            uint256 contractAmount = (totalPrize * 10) / 100;

            payable(winner).transfer(prizeAmount);
            owner.transfer(ownerAmount);
            payable(address(this)).transfer(contractAmount); // Convert to `payable` here
        }

        gameFinished = true;
    }


    function withdrawFunds() external onlyOwner {
        require(gameFinished, "The game has not finished yet");
        uint256 remainingBalance = address(this).balance;
        payable(owner).transfer(remainingBalance);
    }
}
